Video by @amivitale. A little bit of sweetness to start your week! The inimitable Dave Matthews (@davematthewsband) tries to impress the ladies of @sararacamp in northern Kenya. You could win an incredible, all expense paid 5-day safari to @SararaCamp and help support the important work of @sararafoundation. The trip will be scheduled when it's safe to travel again. Flights and accommodations are included. No matter what, you will be a WINNER knowing your donation is helping  both indigenous people and wildlife thrive. ENTER by clicking on the link in my bio or at omaze.com/safari

