Travel teaches us. It allows us to better understand ourselves, our deep connections to one another and the natural world. Today, I am thrilled to share with you today How We Tread Right (HWTR) – @travelttccanada’s new 5-year sustainability strategy. I am honored to be @treadright's first Wildlife Ambassador and inspired by their commitment to sustainable and regenerative practices. Travel matters and so do your choices.

Join me today by taking the pledge to tread right, now and into the future at treadright.org/pledge. Learn more at ttc.com/how-we-tread-right.
